import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import BillingOperations from "C:\\Users\\GWYNN CUJARDO\\Documents\\GitHub\\e-billing\\src\\components\\BillingOperations.js";
import Transaction from "C:\\Users\\GWYNN CUJARDO\\Documents\\GitHub\\e-billing\\src\\components\\Transaction.js";

const App = () => {
  return (
    <><BillingOperations />
    <Router>
      <Routes>
        <Route path="/billing" exact component={BillingOperations} />
        <Route path="/billing/cignal" component={Transaction} />
        <Route path="/billing/converge" component={Transaction} />
        <Route path="/billing/home-credit" component={Transaction} />
        <Route path="/billing/maynilad" component={Transaction} />
